import React from 'react'
import { useParams } from 'react-router'
const Catalog = () => {
    const {category} = useParams();
    return (
        <div style={{padding: "80px 0"}}>
            <h2>{category === 'movies' ? "Movies" : "TV Series"}</h2>
        </div>
    )
}

export default Catalog
